import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Home.css";
import styled from "styled-components";

function Home() {
  const [like , setLike] = useState(0);
  useEffect(() => {
    setLike(like);
  }, [setLikelike]);
  const liked = () => {
    setLike(like + 1);
  }
  return (
    <>
      <h1 style={{textAlign:"center"}}>MY PROJECTS</h1>
      <div >
          <div className="col-md-4">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">Callback Task</h5>
                <p className="card-text">Likeüëç</p>
                <Link to="/calling" className="btn btn-primary">
                  View Project
                </Link>
              </div>
            </div>
          </div>
          </div>
          <div className="col-md-4">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">Table Generation</h5>
               <button  onClick= {liked} style={{border:"none", background: "transparent"}}> <p className="card-text">Likeüëç</p>
               <p>{like}</p></button>  
                <Link to="/Table" className="btn btn-primary">
                  View Project
                </Link>
              </div>
            </div>
          </div>
          <div className="col-md-4">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">Redux</h5>
                <p className="card-text">Likeüëç</p>
                <Link to="/counter-redux" className="btn btn-primary">
                  View Project
                </Link>
              </div>
            </div>
          </div>
      
      
    </>
  );
}

export default Home;
